{"cells":[{"cell_type":"markdown","metadata":{"id":"5-Rf51TkUX7f"},"source":["# **cv2.calibrateCameraでカメラ内部パラメータを取得する**\n","\n","https://onl.la/s4mgPCE\n","<br>\n","上のファイルで使用するチェスボード画像と補正したい画像を処理してから使用する"]},{"cell_type":"code","execution_count":null,"metadata":{"colab":{"base_uri":"https://localhost:8080/"},"executionInfo":{"elapsed":3833,"status":"ok","timestamp":1646289786917,"user":{"displayName":"kazusa hatakeyma","photoUrl":"https://lh3.googleusercontent.com/a-/AOh14Gj57FQLA6neUP_BhjC9gCZ3eub6ddAKfhBrzwiv=s64","userId":"03885894298421071301"},"user_tz":-540},"id":"l8fmgTqsl4eu","outputId":"8679e84d-e049-4fef-b68f-2422f31da648"},"outputs":[{"name":"stdout","output_type":"stream","text":["Mounted at /gdrive\n"]}],"source":["from google.colab import drive\n","drive.mount('/gdrive')"]},{"cell_type":"code","execution_count":7,"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":936},"executionInfo":{"elapsed":8432,"status":"ok","timestamp":1646371929819,"user":{"displayName":"kazusa hatakeyma","photoUrl":"https://lh3.googleusercontent.com/a-/AOh14Gj57FQLA6neUP_BhjC9gCZ3eub6ddAKfhBrzwiv=s64","userId":"03885894298421071301"},"user_tz":-540},"id":"2FjGP5Sw9TPP","outputId":"536fc0a0-c8cc-4542-bd3f-4899736bd587"},"outputs":[{"output_type":"stream","name":"stdout","text":["Camera matrix : \n","\n","[[839.84337298   0.         501.48756037]\n"," [  0.         840.87202156 374.81922135]\n"," [  0.           0.           1.        ]]\n","dist : \n","\n","[[ 2.10089651e-01 -1.52231672e+00  2.29533931e-03  4.25612227e-03\n","   2.99927367e+00]]\n"]},{"output_type":"display_data","data":{"image/png":"\n","text/plain":["<PIL.Image.Image image mode=RGB size=1008x756 at 0x7FDED79FDFD0>"]},"metadata":{}}],"source":["import cv2\n","import numpy as np\n","import os\n","import glob\n","from google.colab.patches import cv2_imshow\n","\n","\n","# Defining the dimensions of checkerboard\n","CHECKERBOARD = (7,10)\n","\n","# //////////////////////////////////////////////////////////////////////////////////////////////////////////////\n","# cv2.TERM_CRITERIA_EPS:指定された精度(epsilon)に到達したら繰り返し計算を終了する\n","# cv2.TERM_CRITERIA_MAX_ITER:指定された繰り返し回数(max_iter)に到達したら繰り返し計算を終了する\n","# cv2.TERM_CRITERIA_EPS + cv2.TERM_CRITERIA_MAX_ITER : 上記のどちらかの条件が満たされた時に繰り返し計算を終了する\n","criteria = (cv2.TERM_CRITERIA_EPS + cv2.TERM_CRITERIA_MAX_ITER, 30, 0.001)\n","\n","# Creating vector to store vectors of 3D points for each checkerboard image\n","objpoints = []\n","# Creating vector to store vectors of 2D points for each checkerboard image\n","imgpoints = [] \n","\n","\n","# Defining the world coordinates for 3D points\n","objp = np.zeros((1, CHECKERBOARD[0]*CHECKERBOARD[1], 3), np.float32)\n","objp[0,:,:2] = np.mgrid[0:CHECKERBOARD[0], 0:CHECKERBOARD[1]].T.reshape(-1, 2)\n","prev_img_shape = None\n","\n","# フォルダ内のjpg画像パスを一括取得\n","IMAGES = glob.glob('/content/drive/MyDrive/CVCameraCalibrateImages/D_ResizeChessPatternImages/*.jpg')\n","\n","for filepath in IMAGES:\n","    img = cv2.imread(filepath)\n","    gray = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)\n","    \n","    # 画像からチェスボードの角を取得する\n","    # 画像から角をがみつかればretにTrueを宣言する\n","    ret, corners = cv2.findChessboardCorners(gray, CHECKERBOARD, cv2.CALIB_CB_ADAPTIVE_THRESH + cv2.CALIB_CB_FAST_CHECK + cv2.CALIB_CB_NORMALIZE_IMAGE)\n","    \n","    \"\"\"\n","    If desired number of corner are detected,\n","    we refine the pixel coordinates and display \n","    them on the images of checker board\n","    \"\"\"\n","    if ret == True:\n","        objpoints.append(objp)\n","\n","        # refining pixel coordinates for given 2d points.\n","        corners2 = cv2.cornerSubPix(gray,corners,(11,11),(-1,-1),criteria)\n","        \n","        imgpoints.append(corners2)\n","\n","        # 角を画像に描写\n","        img = cv2.drawChessboardCorners(img, CHECKERBOARD, corners2,ret)\n","\n","    \n","    # 角を描写したチェス画像の表示\n","    # cv2_imshow(img)\n","\n","    # img_drawChessboardCornersフォルダにチェスボードのコーナー検出画像を保存\n","    # cv2.imwrite('/content/drive/MyDrive/CVCameraCalibrateImages/D_DrawCorners/' + 'DC' + str(os.path.basename(filepath)), img)\n","\n","# 画像の高さと幅を取得\n","h,w = img.shape[:2]\n","\n","\"\"\"\n","Performing camera calibration by \n","passing the value of known 3D points (objpoints)\n","and corresponding pixel coordinates of the \n","detected corners (imgpoints)\n","\"\"\"\n","ret, mtx, dist, rvecs, tvecs = cv2.calibrateCamera(objpoints, imgpoints, gray.shape[::-1],None,None)\n","\n","# print(\"ret : \\n\")\n","# print(ret)\n","print(\"Camera matrix : \\n\")\n","print(mtx)\n","print(\"dist : \\n\")\n","print(dist)\n","# print(\"rvecs : \\n\")\n","# print(rvecs)\n","# print(\"tvecs : \\n\")\n","# print(tvecs)\n","\n","# # Using the derived camera parameters to undistort the image\n","\n","# for filepath in IMAGES:\n","\n","#     img = cv2.imread(filepath)\n","#     # Refining the camera matrix using parameters obtained by calibration\n","#     # ROI:Region Of Interest(対象領域)\n","#     newcameramtx, roi = cv2.getOptimalNewCameraMatrix(mtx, dist, (w,h), 1, (w,h))\n","\n","#     # Method 1 to undistort the image\n","#     dst = cv2.undistort(img, mtx, dist, None, newcameramtx)\n","\n","#     # undistort関数と同じ結果が返されるので、今回はコメントアウト(initUndistortRectifyMap()関数)\n","#     # Method 2 to undistort the image\n","#     # mapx,mapy=cv2.initUndistortRectifyMap(mtx,dist,None,newcameramtx,(w,h),5)\n","#     # dst = cv2.remap(img,mapx,mapy,cv2.INTER_LINEAR)\n","\n","#     # 歪み補正した画像を表示\n","#     cv2_imshow(dst)\n","\n","# 指定したパスの画像を取得\n","IMAGES = glob.glob('/content/drive/MyDrive/CVCameraCalibrateImages/D_SampleImages/QTobacco.jpg')\n","\n","# Using the derived camera parameters to undistort the image\n","for filepath in IMAGES:\n","\n","    # 画像の取得\n","    img = cv2.imread(filepath)\n","\n","    # 高さを定義する\n","    # height = img.shape[0]\n","\n","    # 幅を定義\n","    # width = img.shape[1]\n","\n","    # 4分の１リサイズ\n","    # imgResize = cv2.resize(img, (int(width/4), int(height/4)) )\n","\n","    # リサイズした画像の高さ、幅の取得\n","    h,w = img.shape[:2]\n","\n","    # Refining the camera matrix using parameters obtained by calibration\n","    # ROI:Region Of Interest(対象領域)\n","    newcameramtx, roi = cv2.getOptimalNewCameraMatrix(mtx, dist, (w,h), 1, (w,h))\n","\n","    # Method 1 to undistort the image\n","    dst = cv2.undistort(img, mtx, dist, None, newcameramtx)\n","\n","    # 広角歪み補正をした画像を表示\n","    cv2_imshow(dst)\n","\n","    # 歪み補正した画像をimg_undistortフォルダへ保存\n","    cv2.imwrite('/content/drive/MyDrive/CVCameraCalibrateImages/D_CalibrationImage/' + 'Calib' + str(os.path.basename(filepath)), dst)"]},{"cell_type":"markdown","metadata":{"id":"iH2Pug_xyCzR"},"source":["# **iphoneSE(2020)キャリブレーション結果**\n","\n","**焦点距離**\n","<br>\n","fx = 839.84337298\n","<br>\n","fy = 840.87202156\n","<br>\n","\n","**光学中心**\n","<br>\n","Cx = 501.48756037\n","<br>\n","Cy = 374.81922135\n","<br>\n","\n","\n","**歪み係数**\n","<br>\n","k1 = 2.10089651e-01\n","<br>\n","k2 = -1.52231672e+00\n","<br>\n","p1 = 2.29533931e-03\n","<br>\n","p2 = 4.25612227e-03\n","<br>\n","k3 = 2.99927367e+00\n","<br>\n","\n","****\n","# **備考**\n","*   チェスボード画像は4分の1の画素数にエンコード\n","*   横向きで撮影\n","*   広角補正したい画像も同じ画素数(4分の1)に合わせる必要がある\n","\n","# **参考**\n","<br>\n","\n","https://qiita.com/souring001/items/d4312c2bdcd19016aab4\n","\n","<br>\n","\n","https://miyashinblog.com/opencv-undistort/"]}],"metadata":{"colab":{"collapsed_sections":[],"name":"cameraCalibrationWithUndistortion.py","provenance":[],"mount_file_id":"13eEYpHTN4m_3vQ9cxxbmqdr0Y0Ob-_Kx","authorship_tag":"ABX9TyOU2exeUu/ooQFEUA96mcky"},"kernelspec":{"display_name":"Python 3","name":"python3"},"language_info":{"name":"python"}},"nbformat":4,"nbformat_minor":0}